INSERT INTO `animals` VALUES (1,'Eden','Eden_1_6491fb048c840.jpg','Eden_2_6491fb048c8ea.jpg','Eden_3_6491fb048c904.jpg','Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','Available / In Foster Home','Mixed Breed','Young','White/Black','Female','Medium',0,325.00,''),(3,'Buddy','Buddy_1_649fa6850113c.jpg','Buddy_2_649fa68501172.jpg','Buddy_3_649fa68501188.jpg','Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. Fixed, UTD on vaccines, microchipped, HW-.','Available / In Foster Home','Labrador Retriever & Beagle Mix','Young (1 Year)','White, Brown','Male','Medium',0,325.00,''),(4,'Emmy','Emmy_1_671739709a6d6.jpg','Emmy_2_67173970d105c.jpg','Emmy_3_67173970f04f9.jpg','EMMY has been with Champs Chance for about 1.5 years and was one of our first intakes with her sister, Ally. Emmy is approximately 3 years old and 40 lbs. She has kenneled with males and females her size and has done well with both. Emmy seems to be potty and crate-trained and has been in foster homes for very short periods of time. This sweet girl has been waiting most of her life for a home, and we would love to find her a long-term foster home to continue her heartworm treatment! Although she is an energetic girl, Emmy will need to be kept relatively calm during treatment. She would love someone to cuddle and go on walks with.','Available','Labrador Retriever & Pit Bull Terrier Mix','Young','White/Brindle','Female','Large',0,325.00,''),(5,'Ally','Ally_1_649df2876bc66.jpg','Ally_2_6632e20d4fb5e.jpg','Ally_3_649df2876bcb3.jpg','Ally is a very good sport and loves hamming it up for the camera. We think she figures she\'ll do whatever she has to in order to find her forever family. If you\'re looking for an Instagram star, this smiley girl could be your perfect match. Ally was found as a stray with her sister Emmy when they were still puppies. Just over a year old as of March 2022, she is hoping that her stellar personality and being good with other dogs will help her find a forever home. This brown-eyed beauty deserves nothing less. Ally is both potty & crate-trained. She loves to go on runs or snuggle up all day. Ally is even bilingual!\r\n|a\r\n\r\nFixed, UTD on vaccines, microchipped, HW-.','Available / In Foster Home','Labrador Retriever & Pit Bull Terrier Mix','Young','White/Brindle','Female','Medium',0,325.00,''),(7,'Dorothy','Dorothy_1_649df31947ce9.jpg',NULL,NULL,'Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home.','Available / In Foster Home','Labrador Retriever Mix','Adult','Black','Female','Medium',NULL,325.00,''),(8,'Cindy Lou','Cindy Lou_1_649fa73d161d0.jpg','Cindy Lou_2_649fa716c183d.jpg','Cindy Lou_3_64c541485076d.jpg','Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. Undergoing heartworm treatment.\r\n','Available / In Foster Home','Mixed Breed','Adult','White/Black','Female','Medium',NULL,325.00,''),(9,'Mori','Mori_1_6609781b932de.jpg','Mori_2_6609781bc2d69.jpg','Mori_3_6609781bf2ea5.jpg','MORI has been with Champs Chance for approximately 10 months. She came to us as a stray in the woods with milk dripping from her, but no puppies were anywhere to be found, leading us to believe she had been dumped very shortly after giving birth. Mori has been in short-term fosters before and is potty trained. She is a very calm dog and loves to snuggle, and she is one of our most loving girls by far! She gets along well with males her size, but we always recommend a meeting prior to foster commitment and a home with no female dogs or small children. She is currently going through heartworm treatment.','Available / In Foster Home','Mixed Breed','Adult','Black/White','Female','Medium',NULL,325.00,''),(10,'Bellamy','Bellamy_1_64f13f771d1d2.jpg','Bellamy_2_64f13f771d216.jpg','Bellamy_3_64f13f771d22b.jpg','Meet BELLAMY!\r\n\r\nBellamy has been with us for a while after being surrendered from a farm home. We were told he did not do well with the farm animals such as chickens and pigs, so he will not be able to be in such a home environment. However, his short-term fosters during the January storm front gave us fantastic feedback of how he does in a traditional fenced yard home with other dogs!\r\n\r\n\"Mr. Bellamy was a great house guest for the cold weather break from the rescue. He has been friendly with all our dogs [small/medium], easy to correct, and eager to please. He needs slow introductions to new people and may have issues with large reactive dogs. He met each of our dogs individually and all he wanted to do was play with everyone!\"\r\n\r\nBellamy will need a foster or adopter with experience with large dogs due to his size. Once he gets to know you, he is the cuddliest dog out there! All he\'s wanted for a long time is a home that loves him unconditionally and will not judge him for his size or look.','Available','Mixed Breed','Adult','White/Brindle','Male','Large',NULL,325.00,''),(11,'Polly','Polly_1_64f13ee49e0de.jpg','Polly_2_64f13eae06f4c.jpg','Polly_3_649df494c5d86.jpg','Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. Fixed, microchipped, UTD on vaccines, HW-.\r\n\r\n','Available / In Foster Home','Mixed Breed','Adult','Black','Female','Medium',NULL,325.00,''),(14,'Lizzie','Lizzie_1_65e099b80338b.jpg','Lizzie_2_65e099956f176.jpg','Lizzie_3_65e09995a12af.jpg','Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. Fixed, UTD on vaccines, microchipped, HW-.\r\n\r\nLizzie is a sweet and playful pup! Lizzie does well with others and loves to play!\r\n\r\n','Available / In Foster Home','Pointer/Lab Mix','Young (1 Year)','White/Brown','Female','Medium',NULL,325.00,''),(15,'Buddy Boy','Buddy Boy_1_6499d4ad0203b.jpg',NULL,NULL,'BUDDY BOY loves to be close to his human, he is a very sweet boy, he is a little nervous at first, but that\'s because he has been through a lot in his short life. Buddy has had ACL repair surgery done March 2023 and was then abandoned by what he thought was his forever family shortly after. Buddy loves to play with other dogs and is a very good boy. He has always been respectful of other dogs and his 4 foster fur siblings. He is eager to please so it would be easy to teach new tasks to him. We can\'t say enough how sweet he is!! Please please help Buddy Boy find a forever home full of love and patience. You will not regret giving him a home. Fixed, UTD on vaccines, microchipped, HW-.','Available / In Foster Home','Pit Bull Terrier','Adult','Black','Male','Large',NULL,325.00,''),(17,'Cameron','Cameron_1_64c53de7ae0cf.jpg','Cameron_2_64c53de7ae102.jpg','Cameron_3_64c53de7ae116.jpg','Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. Fixed, UTD on vaccines, microchipped, HW+. Undergoing heartworm treatment.\r\n','Available / In Foster Home','Bulldog Mix','Adult','White/Tan','Male','Medium',NULL,325.00,''),(22,'Daisy','Daisy_1_65a3338ec2b53.jpg','Daisy_2_65a3338ec2b91.jpg','Daisy_3_65c9b9e564593.jpg','Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home.\r\nFixed, UTD on vaccines, microchipped, HW-.','Available','Terrier Mix','Young','White/Black Spotted','Female','Large',NULL,325.00,''),(23,'Red Sox','Red Sox_1_6558ed0309d44.jpg','Red Sox_2_6558ed0309d83.jpg','Red Sox_3_65a9e4a88a256.jpg','Meet Red Sox!','Available / In Foster Home','Hound Mix','Young','Tan/Brown','Male','Medium',NULL,325.00,''),(25,'Scooby','Scooby_1_651d189cbda28.jpg','Scooby_2_651d189cbda5c.jpg','Scooby_3_651d189cbda6f.jpg','Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. Fixed.','Available','Boxer Mix','Young','Brindle/White','Male','Large',NULL,325.00,''),(27,'Fergus','Fergus_1_65e08db3a1276.jpg','Fergus_2_65e08db3c8f3a.jpg','Fergus_3_65a18b0bcef7b.jpg','Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','Available / In Foster Home','Pitbull Mix','Young','Brindle/White','Male','Medium',NULL,325.00,''),(28,'Frenchie','Frenchie_1_651d11ea392ea.jpg',NULL,NULL,'Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home.','On hold / Unavailable','Mixed Breed','Young','Brown/Brindle','Female','Medium',NULL,325.00,''),(29,'Hope','Hope_1_651c372c5f25d.jpg','Hope_2_65cf7709809f7.jpg','Hope_3_651c372c5f2a9.jpg','Sweet Hope is one of our longest residents at the rescue. She came to us from South Carolina, and she had been recovering from what looked to be a coyote attack. Hope is a very sweet girl who loves to show affection . She loves her walks and just being outside in general. Hope is very well trained. She does take a little bit to warm up due to her past but when she does she will love you and protect you. She’s silly in the cutest ways and would benefit from a home with people that can be there for her and help her be more confident as she is a little shy and scared. She is fully potty trained! Hope must be in a home with no other pets. ','Available / In Foster Home','Mixed Breed','Adult','Tan/White','Female','Medium',NULL,325.00,''),(34,'Topper','Topper_1_6558eefe21e4a.jpg','Topper_2_6558eefe21e88.jpg',NULL,'Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home.\r\n','Available / In Foster Home','Mixed Breed','Adult','Brown','Male','Medium',NULL,325.00,''),(41,'Princess','Princess_1_65a334bb3baf3.jpg','Princess_2_65a334bb3bb36.jpg','Princess_3_65a334bb3bb4e.jpg','Princess had a rough start, coming to us from the top of a euthanasia list at a rural shelter in Alabama a few months ago. We knew she did not deserve to die and had to save this sweet girl. Princess appears to be a lab or hound mix, weighs approximately 40lbs, and we believe her age to be 2-3 years old.\r\n\r\nPrincess can be described as a cuddly, loving girl who is eager to lay in bed or have some fun, whatever her person is up to! She does well with other dogs but an introduction prior to adoption is always recommended.\r\n\r\nPrincess is potty trained, spayed, UTD on vaccines, and heartworm positive. All costs of heartworm treatment are covered by Champs Chance and her adoption fee of $200. ','Available / In Foster Home','Chocolate Lab/Hound Mix','Adult','Brown','Female','Large',NULL,325.00,''),(44,'Bubba','Bubba_1_65e3ba3e1b5e7.jpg','Bubba_2_65e3ba1529dc7.jpg',NULL,'Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. Undergoing heartworm treatment.\r\n','Available / In Foster Home','Mixed Breed','Adult','Brown','Male','Medium',NULL,325.00,''),(45,'Sidney','Sidney_1_65a3317a48487.jpg','Sidney_2_65a3317a484c3.jpg','Sidney_3_65a3317a484d9.jpg','Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','Available','Jack Russell Mix','Young','White/Red','Female','Small',NULL,325.00,''),(47,'Leilani','Leilani_1_65e7deb2223ef.jpg','Leilani_2_65ccdb6e91b2e.jpg','Leilani_3_65e7deb23649f.jpg','Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','Available / In Foster Home','Shepherd Mix','Puppy','Brown','Female','Medium',NULL,325.00,''),(53,'Wes','Wes_1_65f2e0b5348ef.jpg',NULL,'Wes_3_65f2e0b562acf.jpg','Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','Available / In Foster Home','Shepherd/Hound Mix','Adult','Brown/Tan','Male','Medium',NULL,325.00,''),(54,'Auggie','Auggie_1_6600cf8386687.jpg','Auggie_2_660706846d3f9.jpg','Auggie_3_660706848f126.jpg','Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','Available / In Foster Home','Shepherd/Hound Mix','Adult (2 Years)','Brown/Tan','Male','Medium',NULL,325.00,''),(61,'Serena','Serena_1_65cfb2a4e06b0.jpg',NULL,NULL,'Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','Available / In Foster Home','Coonhound','Adult','White/Beige','Female','Medium',NULL,325.00,''),(89,'Waylon','Waylon_1_667f003986de0.jpg','Waylon_2_667f0039d22f9.jpg','Waylon_3_667f003a1bcbe.jpg','Meet Waylon! This boy experienced a terrible start to life. We found him on the side of the road, completely emaciated, just skin and bones. Who knows how long he laid there, waiting for someone to rescue him. We were able to get him back to health, and into a cozy bed! He is now patiently awaiting his forever home, where he can be comfortable forever. Waylon is a handsome sweetheart. He loves to relax, but also enjoys playing fetch! He cuddles with all his toys and people. ','Available / In Foster Home','Mixed Breed','Adult','Tan','Male','Medium',NULL,325.00,''),(90,'Vanna White','Vanna White_1_65f2de974f312.jpg','Vanna White_2_65f2de977425e.jpg','Vanna White_3_65f2de979f264.jpg','Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','Available / In Foster Home','Mixed Breed','Adult','White','Female','Medium',NULL,325.00,''),(92,'Honey','Honey_1_65e7de30a1619.jpg','Honey_2_65e7de30c9788.jpg',NULL,'Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home.','Available / In Foster Home','Mixed Breed','Adult','Tan','Female','Medium',NULL,325.00,''),(94,'Sam','Sam_1_65f2dff3c9186.jpg','Sam_2_65f2dff3ed5ac.jpg','Sam_3_65f2e0378ff66.jpg','Sam is the sweetest man ever! He is potty trained as well as crate trained. He is active and loves to go on runs with me, but he also is so sleepy most of the day and loves to cuddle and watch movies! Sam is sweet and never bites or barks. He loves all people! He is 55 lbs! He doesn\'t bite or chew anything unless it\'s his toys! Sam knows how to sit and stay and he\'s super active and loves to play catch, he also loves the pool! Sam is a really awesome dog! ','Available / In Foster Home','Labrador Retreiver Mix','Adult','Black/White','Male','Medium',NULL,325.00,''),(97,'Keith','Keith_1_65e7de5ebebbc.jpg','Keith_2_66d20bbee0b54.jpg','Keith_3_66d20bbf843d7.jpg','Keith was rescued by Champs Chance from a backyard breeder situation. Him and his brother Toby lived the beginning of their life tied to a tree, on short chains.  He may be a bit shy at first, but once he warms up to you, he is the most loving and affectionate companion you could ask for. He adores making new dog friends. He is potty trained and crate trained and enjoys a walk on the leash once he’s comfortable. Keith doesn’t bark often! He loves to give kisses, and will only sit on the couch if you’re there to join him. Keith’s gentle nature and kind heart make him a beloved member of his human family and a joy to anyone lucky enough to meet him.','Available / In Foster Home','Mixed Breed','Adult','Brown/White','Male','Medium',NULL,325.00,''),(99,'Joffrey','Joffrey_1_65f2df8455605.jpg','Joffrey_2_666325fdd61ff.jpg','Joffrey_3_666325fe08ae0.jpg','Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home.\r\n\r\nThis sweet boy is the perfect addition to any home. He absolutely adores people and loves to be by their side! Joffrey enjoys getting butt scratches, playing with his toys, and snuggling up. He is also a fan of pup cups and plain cheeseburgers. Despite his size, Joffrey is very well-mannered on the leash and does not pull hard. He is the definition of a gentle giant, this big teddy bear just wants to love and be loved on! We believe Joffrey would do best as the only pet in the home. Don’t worry though, just one of him is enough love to last a lifetime! ','Available / In Foster Home','Mixed Breed','Adult','Brown/White','Male','Medium',NULL,325.00,''),(110,'Big Girl','Big Girl_1_65ee6a76a3397.jpg','Big Girl_2_65ee6a77364eb.jpg','Big Girl_3_65ee6a77c3315.jpg',' Big Girl is a 5 year old German Shepard that was abandoned to no fault of her own. She is fully vetted, HW negative and spayed. She’s house trained, crate trained, knows many commands, gets along with cats and other dogs, loves car rides and walks well on a leash. Her favorite past time is playing soccer or with her red ball. She’s perfectly well mannered and in excellent health.','Available / In Foster Home','German Shepard ','Adult ','Tan and Black','Female','Large',NULL,325.00,''),(111,'Meatloaf','Meatloaf_1_65f2df360110a.jpg','Meatloaf_2_65f2df36248d5.jpg','Meatloaf_3_65f2df3646eb3.jpg','Meatloaf is a laid back couch potato looking for a forever home. He is potty trained and has not\r\nhad any accidents since we have had him! He doesn’t like to be in a cage so we usually just let\r\nhim roam around the apartment if we are away and he does not get into anything he shouldn’t!\r\nMeatloaf is a cuddle bug who wants attention 24/7 and will jump up on the couch to be with you\r\nor constantly by your side to be pet. Meatloaf uses a slow feeder because he is definitely a food\r\nmotivated dog and loves any and all treats he can get his hands on. Meatloaf does not bite and\r\nis not aggressive towards people. He is ok around smaller dogs but tends to get defensive\r\naround bigger dogs. However, he is getting better about this! Meatloaf is an absolute gem and\r\nperfect addition to any household. He loves toys, baths, and treats. He also knows how to sit!\r\nMeatloaf is deserving of the best home where he can be with his family often since he doesn’t\r\nlike to be left alone (since he loves attention). Come see Meatloaf today!','Available','Mixed Breed','Adult','Brown','Male','Medium',NULL,325.00,''),(116,'Shadow','Shadow_1_660977b079dbf.jpg','Shadow_2_660977b0ab58e.jpg','Shadow_3_660977b0df87c.jpg','Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home.','Available / In Foster Home','Mixed Breed','Puppy','Black','Female','Medium',NULL,325.00,''),(120,'Peppa','Peppa_1_67173cedcef3c.jpg','Peppa_2_67173cee2f4a7.jpg','Peppa_3_67173cee6c693.jpg','Sweet Peppa was abandoned at a Boy Scout center and rescued by Champs Chance. It took us a bit to gain her trust, but once she realized she was safe, her true personality came out! Peppa has a heart of gold and is an absolute ray of sunshine.  She has a very calm demeanor, and enjoys resting on the couch and getting lots of snuggles. Peppa would benefit best from a quiet home. She is fully potty trained! Peppa is polite on a leash and enjoys her walks. We believe Peppa would be best as the only pet in the home. All this beautiful girl wants is a family of her own.  ','Available','Mixed Breed','Adult','Brindle','Female','Medium',NULL,325.00,''),(123,'Timber','Timber_1_6600cd6e8774e.jpg',NULL,NULL,'Meet Timber, our bashful girl seeking a forever home! ? This sweet hound was found as a stray, and her heart is still mending. Timber\'s shyness is like a delicate flower waiting to bloom with love and patience.  Let\'s make her life extra special by finding Timber a loving family who will take the time to earn her trust and shower her with affection.  If you have room in your heart for a gentle soul, consider giving Timber the love-filled home she deserves. Together, let\'s make Timber\'s heart dance with joy!','Available / In Foster Home','Hound Mix','Adult','Tan/White','Female','Medium',NULL,325.00,''),(126,'Curly','Curly_1_66ad43e39b355.jpg','Curly_2_661968d0cbdb3.jpg',NULL,'Curly came to us from Blountstown Police Department with his brothers Larry and Mo.  His brothers have been adopted so we need to find Curly his forever family.  Curly loves everyone that comes through the door and has never met a stranger.  He is great on walks and car rides, fully potty trained, loves lounging on the couch and is good with kids and dogs. Curly has a bit of separation anxiety if his family leaves for long periods of time. He would do best in a home with another dog! Curly has such a beautiful, gentle soul with so much love and joy to share.  ','Available / In Foster Home','Dachshund Mix ','Adult','Brown/White','Male','Small',NULL,325.00,''),(132,'Bambi','Bambi_1_66ad60be6944e.jpg','Bambi_2_66ad60beb956f.jpg','Bambi_3_66ad60bf09dd3.jpg','Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','Available / In Foster Home','Mixed Breed','Adult','Black/White','Female','Medium',NULL,325.00,''),(149,'Joey','Joey_1_66130b638b0e2.jpg','Joey_2_66130b639e382.jpg','Joey_3_66130b63b12d9.jpg','Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','Available','Mixed Breed','Young','Brindle/White','Male','Medium',NULL,325.00,''),(150,'Beau','Beau_1_66130cb6bc515.jpg','Beau_2_66130c9cd6633.jpg','Beau_3_66130c9ce9003.jpg','Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','Available / In Foster Home','Mixed Breed','Adult','Orange/White','Male','Medium',NULL,325.00,''),(162,'Ty','Ty_1_664927a8bd9c2.jpg','Ty_2_664927a8e8665.jpg',NULL,'Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','Available / In Foster Home','Blue Heeler/Pointer Mix','Adult','Black/White','Male','Medium',NULL,325.00,''),(181,'sunshine ','sunshine _1_666e838fd582f.jpg','sunshine _2_666e836f5aa43.jpg','sunshine _3_666e83cc349d2.jpg','Meet sunshine! This beautiful girl was found as a stray with her brother. She loves people and is extremely affectionate. Loves to play with her brother and lounge around on her doggy bed. ','Available / In Foster Home','Australian Shepard Mix ','Adult ','Black and white ','Female','Medium',NULL,325.00,''),(182,'Princess ','Princess _1_66624278c2ff2.jpg','Princess _2_666242791e37c.jpg','Princess _3_66624279a766d.jpg','Meet Princess! This sweet girl was dumped after giving birth. We believe she is around 1-2 years old, and she weighs around 30 pounds. Princess is very affectionate and loves to be with her people! She does well with other pets (cats and dogs). She is both potty and crate trained, and is very responsive to commands! This baby has experienced a very rough start to life, and would love to find a forever home where she can relax in. ','Available','Mixed breed ','Adult','Brindle ','Male','Small',NULL,325.00,''),(184,'Ravioli ','Ravioli _1_666e79276a1d3.jpg','Ravioli _2_666e7927b95f0.jpg','Ravioli _3_666e7928acc1c.jpg','Ravioli is an absolute ham! This boy does not have a mean bone in his body. He was rescued from the euthanasia list at his shelter. He is obsessed with belly rubs and getting loved on. He becomes best friends with every dog he meets, and loves to play with them. He gives the best kisses and hugs. Ravioli is the best friend you are looking for. ','Available','Black Mouth Cut mix ','Puppy','Tan ','Male','Small',NULL,325.00,''),(192,'Bandit ','Bandit _1_66720e4ab14e5.jpg','Bandit _2_66720e4b4c6ef.jpg','Bandit _3_66720dbdc77fe.jpg','Meet Bandit! This handsome guy is absolutely ready for a forever home. He was saved from the euthanasia list at his previous shelter. Bandit loves to give hugs and be around his people. He has a playful spirit and would love a family to give him attention. His color is beautiful and his personality is amazing! We believe Bandit would do best as the only dog in the home. ','Available','Australian Shepard Mix ','Adult','Brown and White ','Male','Small',NULL,325.00,''),(193,'Sunny','Sunny_1_667267b515c9f.jpg','Sunny_2_667267b5c0470.jpg','Sunny_3_667267b64220d.jpg','Meet Sunny! This sweet girl was an owner surrender who ended up at Champs. She has been used to living in a home for her whole life, so we would love to place her with a forever family! She is so affectionate, and loves to get loved on. She has a pretty calm demeanor, and is definitely a couch potato. She can also be playful and enjoys having her toys. Sunny also has lived with a small child/baby, and was amazing/gentle! We believe Sunny would do best as the only dog in the home. \r\n','Available','Mixed Breed ','Adult','Tan/White','Male','Small',NULL,325.00,''),(195,'Aspen ','Aspen _1_667efef90a7e6.jpg','Aspen _2_667efef950009.jpg','Aspen _3_667efef9b6f48.jpg','Meet Aspen! This girl has the most beautiful blue eyes and the silliest ears! She is an absolute sweetheart who would make the perfect addition to any family. We reached Aspen from the euthanasia list at her previous shelter. She loves to play with toys, other doggies, and people! This girl is the perfect blend of fun and affection. ','Available / In Foster Home','Australian Blue Heeler/ Catahoula ','Young','White/tan ','Female','Medium',NULL,325.00,''),(196,'Beth','Beth_1_66ad523555691.jpg','Beth_2_667f3eacc4b38.jpg','Beth_3_667f3ead07390.jpg','Meet Beth! This sweet girl was rescued from the euthanasia list at her previous shelter. She was a fantastic personality and would fit in perfectly with a family looking for a very affectionate dog! She does well with other dogs and is currently kenneled with Aspen. Beth is the perfect medium size, and has big floppy ears that add to her cuteness! She is just a happy girl with so much love to give. ','Available / In Foster Home','Beagle/Jack Russell Mix','Young','Black/ White','Female','Medium',NULL,325.00,''),(197,'Skye','Skye_1_667f4220105d9.jpg','Skye_2_66ad6ccf26cf9.jpg','Skye_3_667f4220ec790.jpg','Meet Skye! This handsome hunk is a major lover boy! We pulled him from the euthanasia list at his previous shelter. He gives the best hugs/kisses, and is always looking to get some love. He would make the perfect addition to any family.','Available / In Foster Home','Labrador Mix ','Adult','Black','Male','Large',NULL,325.00,''),(198,'Kayla','Kayla_1_66806baa0a764.jpg',NULL,NULL,'Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','Available / In Foster Home','Staffordshire terrier','Young','White','Female','Medium',NULL,325.00,''),(199,'Annie','Annie_1_66806cbe0fd04.jpg','Annie_2_66ad42bed69ce.jpg',NULL,'Annie is the absolute sweetest chocolate lab in the world! She has all the great qualities of a lab and is a total love bug. She adores doggy friends and snuggling with her human. ','Available / In Foster Home','Chocolate Lab','Adult ','Brown/White','Female','Medium',NULL,325.00,''),(200,'D.G.','D.G._1_66ad4657087a9.jpg','D.G._2_66ad46573ab7c.jpg','D.G._3_66ad46577917e.jpg','Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','Available / In Foster Home','Lab mix ','Puppy','Tan','Male','Large',NULL,325.00,''),(206,'Nola','Nola_1_670c513b9b279.jpg','Nola_2_670c513c05ceb.jpg','Nola_3_670c513c21af3.jpg','Foster Description: \r\nMeet Nola! I have been fostering because of the hurricane. She is looking for a forever home and is the sweetest girl you will ever meet. I immediately fell in love with her. Nola loves people and warms up to them very quickly, and is extremely friendly to anyone she meets. She is great with children and other dogs. She is calm and well behaved but can also be playful and puppy-like. Such a gentle soul with a loving heart who enjoys cuddles and pets. I have a roommate who is afraid of dogs, but she met Nola and immediately felt safe and loves her. She enjoys car rides, walks, toys, and being outdoors. Nola is potty trained and will go number 1 and 2 every time you take her outside. She still needs some help with leash training. She has also already been spayed.','Available / In Foster Home','Mixed breed','Adult','Grey/White','Female','Large',NULL,325.00,''),(208,'Skippy','Skippy_1_66ad4864cfad5.jpg','Skippy_2_66ad48652a757.jpg',NULL,'Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','Available','Mixed breed','Adult','Black, White','Male','Small',NULL,325.00,''),(209,'Cookie','Cookie_1_66ad4899d5caa.jpg','Cookie_2_66ad489ac25f1.jpg',NULL,'Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','Available','Mixed breed','Adult','Tan','Female','Small',NULL,325.00,''),(210,'Okra','Okra_1_66ad4bc03c647.jpg','Okra_2_66ad4bc08998d.jpg','Okra_3_66ad4bc0c9234.jpg','Okra was rescued after being dumped in the woods, extremely emaciated. She has anxiety in loud/city outdoor settings but does great in rural suburban areas. She is potty trained and knows sit. She is low energy and doesn’t really play with toys. She weighs 32 pounds and has no destructive tendencies/no separation anxiety. She is looking for patient parents with time to allow her to adjust to new people and leave her be for a few days. She needs at least one week of accompanied introduction to get used to her family because of nervousness. Friendly with people and so far small low energy dogs in her house. Quirks: She’s like a cat! sleeps all day, will loaf and sit on you & is potty trained to her inside fake grass.','Available / In Foster Home','Shepard Mix','Adult','Tan/Brown','Female','Small',NULL,325.00,''),(211,'Annie','Annie_1_667f4cb6c6fd1.jpg','Annie_2_673b68a923ddd.jpg','Annie_3_673b68a9d4145.jpg','Meet Annie! Annie is a super sweet older dog! She\'s low energy and loves to play, nap, and spend time with people and other dogs. She will let you know when she\'s hungry, and she\'s fully potty trained. She loves all people, but becomes a little nervous around big objects. Annie is an amazing dog and needs a loving home!','Available / In Foster Home','Hound','Adult','White','Female','Small',NULL,325.00,''),(212,'Jenkins','Jenkins_1_667f4d99b714c.jpg','Jenkins_2_667f4d99db023.jpg',NULL,'Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','Available / In Foster Home','Boxer mix','Young','tan','Male','Large',NULL,325.00,''),(213,'Duke','Duke_1_667f4e12be5f2.jpg',NULL,NULL,'Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','Available / In Foster Home','Terrier','Adult','White','Male','Small',NULL,325.00,''),(217,'Hermione ','Hermione _1_671739c12360c.jpg',NULL,NULL,'Hermione is one of the puppies in the Harry Potter litter! \r\n\r\nCome and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home.','Available / In Foster Home','Black Labrador Mix ','Puppy','Black ','Female','Medium',NULL,325.00,''),(220,'Ginny ','Ginny _1_66ad2b99ddc10.jpg','Ginny _2_673b6aa02c71c.jpg','Ginny _3_673b6aa05a396.jpg','Ginny is one of the puppies in the Harry Potter litter! She is truly the sweetest, most loving dog. She’s crate trained but her favorite thing is to sleep with you. She gets the zoomies once a day but other than that she’s pretty lazy. Loves other dogs, gets scared of areas with a lot of noise at first but she does warm up pretty quick. She knows how to sit, come, and is working on the paw command. She also has been good with all the kids she\'s met. She does get protective at night but as long as the other person lets her smell them first she’s totally fine with it. Definitely the type of dog that wants to go everywhere with you. Help Ginny find her furever home.','Available / In Foster Home','Black Labrador Mix','Puppy','Black ','Female','Small',NULL,325.00,''),(221,'Harry ','Harry _1_67173a6178498.jpg',NULL,NULL,'Harry is one of the puppies in the Harry Potter litter! \r\n\r\nCome and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home.','Available / In Foster Home','Black Labrador Mix ','Puppy','Black','Male','Medium',NULL,325.00,''),(223,'Hedwig','Hedwig_1_67173a916d263.jpg','Hedwig_2_67173a91a9d32.jpg','Hedwig_3_67173a91e3efa.jpg','Hedwig is one of the puppies in the Harry Potter litter! \r\n\r\nCome and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home.','Available / In Foster Home','Black Labrador Mix','Puppy','Black','Male','Medium',NULL,325.00,''),(224,'Sage ','Sage _1_673cf9f5a44c5.jpg','Sage _2_673cf9f65c79d.jpg',NULL,'Sage is one of the puppies in the spices litter! \r\n\r\nCome and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home.','Available / In Foster Home','Mixed Breed ','Puppy','Tan/White','Female','Large',NULL,325.00,''),(225,'Thyme','Thyme_1_66ad3f49bf51f.jpg',NULL,NULL,'Thyme is one of the puppies in the spices litter! Thyme is a very loving and playful boy. He is still a puppy so he can be crazy sometimes but he always means well. He is super sweet and is obsessed with toys. He loves long walks and laying in the grass outside. He is the best puppy. \r\n','Available / In Foster Home','Mixed Breed ','Puppy','Brown/White','Male','Small',NULL,325.00,''),(226,'Nutmeg ','Nutmeg _1_66ad3f211b313.jpg',NULL,NULL,'Nutmeg is one of the puppies in the spices litter! \r\n\r\nCome and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home.','Available / In Foster Home','Mixed Breed ','Puppy','Tan/White','Female','Small',NULL,325.00,''),(228,'Cinnamon','Cinnamon_1_66ad4001e576c.jpg',NULL,NULL,'Cinnamon is one of the puppies in the spices litter! \r\n\r\nCome and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home.','Available','Mixed Breed','Puppy','Tan','Male','Small',NULL,325.00,''),(234,'Sheba ','Sheba _1_66ad4ad9ebb09.jpg','Sheba _2_66ad4ada42484.jpg','Sheba _3_66ad4ada85829.jpg','Sheba was dumped at the Wakulla Co. Animal Shelter with only her kennel, not even her name. She was overlooked for weeks and weeks and was set to be euthanized before we rescued her. She\'s a husky/mix and is approximately 60 lbs. She\'s super sweet with her humans and wants to be the only pet in her home so she can shower her humans with attention. However, she does tolerate other dogs. Absolutely no cats! She is extremely smart, loyal, has lots of energy, loves to play catch, take walks and car rides, and give lots of kisses! She is house and crate trained and has learned to sit. She gets excited and still pulls when first on her leash, but she is getting better with every day. She whines quietly at times but has never barked. \r\n','Available / In Foster Home','Husky Mix','Adult','Black/White','Female','Large',NULL,325.00,''),(235,'Violet ','Violet _1_673b719378a47.jpg','Violet _2_673b71939e522.jpg','Violet _3_673b7193bbbfb.jpg','Meet Violet!','Available / In Foster Home','Mixed Breed','Puppy','Dark Brown','Female','Medium',NULL,325.00,''),(236,'Willy','Willy_1_67173d1a758a3.jpg','Willy_2_673f708d51f49.jpg','Willy_3_673f708ed4e72.jpg','Willy is truly the sweetest little guy and is so friendly to everyone and loves to play with dogs too. He loves to cuddle and be with you all the time, but also loves to run and play at the dog park. He will sleep most of the day with a couple energy spurts throughout just like any puppy. He’s mostly potty trained (he tends to go inside when he’s in a new environment for the first time, but if he’s being taken out every couple hours he is very good about it!) We are currently working on crate training for when no one is home and slowly letting him stay out for short periods of time to gain trust. He knows sit and is working on stay. He’s working on walking on a leash, when he gets a scent or excited he tends to pull. He is very food motivated and loves bones and stuffed animal toys. I can’t emphasize enough how sweet he is and everyone who has met him falls in love. He is such a chill dog and would be perfect with a family/kids. ','Available / In Foster Home','Mixed Breed ','Puppy','White','Male','Medium',NULL,325.00,''),(237,'Charlie ','Charlie _1_66ad4da3c37c4.jpg',NULL,NULL,'Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','Available / In Foster Home','Mixed Breed ','Puppy','Light Brown ','Male','Medium',NULL,325.00,''),(238,'Bow','Bow_1_66ad4e40b88cb.jpg',NULL,NULL,'Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','On hold / Unavailable','English Pointer/terrier mix ','Puppy','Black and White','Female','Small',NULL,325.00,''),(239,'Arrow ','Arrow _1_66ad4e74bae0f.jpg',NULL,NULL,'Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','Available / In Foster Home','English Pointer/terrier mix ','Puppy','Black/White','Female','Small',NULL,325.00,''),(240,'Chestnut','Chestnut_1_6717331332a62.jpg','Chestnut_2_671733137c96d.jpg','Chestnut_3_673b696be6512.jpg','Meet Chestnut! Chestnut is very good about letting you know when she needs to go to the bathroom. She usually stands by the front door and waits for you to take her. She has had little to no accidents inside. She is a very friendly, energetic dogs who is great with people and great with other animals. Chestnut is crate trained and doesn’t bark or whine in her crate unless she needs to go potty. She knows how to sit, shake, lay, and stay all with commands. She loves being lazy and cuddling but loves running around and playing even more. She loves attention and is very playful, but she knows her boundaries and doesn’t play too rough. She’s is a loyal friend and is a great puppy. ','Available','Blackmouth Cur Mix','Puppy','Brown ','Female','Medium',NULL,325.00,''),(241,'Daphne','Daphne_1_6717417e80439.jpg',NULL,NULL,'Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. ','Available / In Foster Home','Hound Mix ','Puppy','Black/Brown ','Female','Small',NULL,325.00,''),(242,'Lola','Lola_1_66ad4f270ab36.jpg','Lola_2_66ad4f275b519.jpg','Lola_3_66ad4f27ba55f.jpg','Come and meet our adorable and friendly dog, the perfect furry companion t