'),(258,'Ginger ','Ginger _1_66ad5c7b73c3d.jpg',NULL,NULL,'Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. \r\n','On hold / Unavailable','Mixed Breed ','Puppy','Light Brown/White','Female','Small',NULL,325.00,''),(260,'Professor ','Professor _1_66ad5d4abec43.jpg',NULL,NULL,'Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. \r\n','Available / In Foster Home','Mixed Breed ','Puppy','Grey/White','Male','Small',NULL,325.00,''),(261,'Skipper ','Skipper _1_67173d8b3e23a.jpg','Skipper _2_673f6fd421cb6.jpg','Skipper _3_673f6fd44ab29.jpg','Meet Skipper!','Available / In Foster Home','Mixed Breed','Puppy','Grey/White','Male','Medium',NULL,325.00,''),(263,'Cain','Cain_1_66ad5fe95e34d.jpg','Cain_2_673f6b569b81b.jpg','Cain_3_66ad5fe9e5e52.jpg','Cain is an incredibly playful and energetic dog who loves life and everyone he meets. He’s happiest when surrounded by people and will never say no to a good cuddle session. He has the curiosity of a young dog and gets excited about exploring anything new, whether it\'s a new toy, a new scent, or just following you around to see what you’re up to. While Cain can get a little too hyper at times, taking him out to play or a long walk can do the trick. He’s currently working on his potty training, and even though it’s a work in progress, he’s catching on quickly. One of Cain’s best qualities is how friendly and gentle he is—he’s not aggressive at all and rarely barks. He’s an all-around good boy who brings so much happiness and energy wherever he goes!\r\n\r\n\r\n','Available / In Foster Home','Mixed Breed ','Young','Tan/White','Male','Medium',NULL,325.00,''),(264,'Landon','Landon_1_66ad6238aa794.jpg','Landon_2_66ad6238f2473.jpg',NULL,'Landon is a sweet senior who needs a special person to give him a cozy home! This sweet boy was pulled only hours before he was set to be euthanized, how could you not love that smile. Landon is potty trained! Landon is the friendliest pup and loves other dogs and kids! His is crate and leashed train and knows a few commands… what a smart boy! Landon struggles with arthritis but what old man doesn\'t? He would benefit best from a home without stairs. ','Available / In Foster Home','Mixed Breed','Adult','Brown/White','Male','Large',NULL,325.00,''),(267,'Jovie ','Jovie _1_66b6aa7ef0386.jpg','Jovie _2_66b6aa7f3f9a6.jpg','Jovie _3_66b6aa7f5048e.jpg','Jovie is a happy puppy that loves to play. Would be best in an active home as he really likes to run. He would do well with another playful companion. He is almost potty trained. Working very hard on that with rare incidents at this point. He\'s smart, highly food motivated. Loves kids, but is teething and doesn\'t know his strength. He\'s great with other dogs and cats. He a snuggle bug and wants to cuddle to sleep. Not the biggest fan of crates! ','Available / In Foster Home','Mixed Breed','Puppy','Brown ','Male','Small',NULL,325.00,''),(268,'Finn','Finn_1_66e0be63bf070.jpg','Finn_2_66e0be643d533.jpg','Finn_3_66e0be6468090.jpg','Meet Finn, a charming 9-month-old chocolate lab! With his stunning chocolate coat and expressive hazel eyes, Finn is a true head-turner. This energetic pup brings a spark of joy to every moment, whether he\'s bounding around the yard or exploring new adventures at the dog park. Finn loves meeting new friends, both human and pup, and is always ready to spread happiness. He would do great in a home with another dog and is kid-friendly and okay with cats. He is both neutered and up to date on shots. He can’t wait to find his forever family and share all the fun and love he has to offer! ','Available / In Foster Home','Chocolate Lab Mix ','Young','Brown','Male','Large',NULL,325.00,''),(269,'Rowdy ','Rowdy _1_670c50317cdb2.jpg','Rowdy _2_670c5031c94d7.jpg',NULL,'Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home.','Available / In Foster Home','Black Lab/Sharpei Mix ','Puppy','Black ','Male','Medium',NULL,325.00,''),(270,'Orco ','Orco _1_67173b550436f.jpg','Orco _2_67173b553421d.jpg',NULL,'Meet Orco! This sweet guy would make the perfect addition to any home. We took him in along with 3 others after they were abandoned at the lake. He definitely makes sure to always show his gratitude as he loves giving hugs to everyone he meets. Orco is great with all people and dogs. He loves to play with furry friends and is very well mannered. He has also done great around kids at adoption events. ','Available / In Foster Home','Mixed Breed ','Adult','Black/White ','Male','Medium',NULL,325.00,''),(271,'Lilo','Lilo_1_6717343e97703.jpg',NULL,NULL,'Meet Lilo! This sweet girl along with her brother Stitch came to us after the recent Hurricane Helene. She is an absolute sweetheart and is great with both people and other dogs. ','Available / In Foster Home','Black lab Mix','Young','Black','Female','Medium',NULL,325.00,''),(272,'Stitch','Stitch_1_6716f3c38fa6f.jpg','Stitch_2_6716f3c468110.jpg',NULL,'Meet Stitch! This sweet boy came to us with his sister Lilo after the recent hurricane Helene. He is amazing with both people and other dogs, an absolute lovebug!','Available / In Foster Home','Black Lab Mix','Young','Black','Male','Medium',NULL,325.00,''),(273,'Stormy','Stormy_1_672d1110c1951.jpg','Stormy_2_672d18bb47734.jpg','Stormy_3_672d18bc22682.jpg','Meet Stormy!','Available','Black Lab Mix','Young','Black','Female','Medium',NULL,325.00,''),(274,'Tiger','Tiger_1_671734c292d7e.jpg','Tiger_2_671734c2f3e18.jpg',NULL,'Meet Tiger! This handsome boy has the most beautiful brindle coat. He is excellent with other dogs and thrives around them. He needs some assistance with leash training. ','Available','Mixed Breed','Adult','Tan/Brown ','Male','Large',NULL,325.00,''),(275,'Charlie','Charlie_1_671734f4cce31.jpg',NULL,NULL,'Meet Charlie! This adorable boy is a total lovebug who is ready to find a forever family!','Available','Lab/Sharpei Mix','Puppy','Tan/Orange ','Male','Medium',NULL,325.00,''),(276,'Bingo ','Bingo _1_671735983ab2c.jpg',NULL,NULL,'Meet Bingo! Bingo is one of our original dogs here at the rescue. He was adopted a little under a year ago, but recently returned at no fault of his own. Bingo is amazing with people and extremely intelligent. He is very chill and enjoys relaxing, but also needs stimulation to keep him entertained. \r\n\r\nHe is not a big fan of crates and gets carsick. The ideal home for Bingo would be someone who is home very often, has no other pets, and wants a super smart/loving new furry friend. ','Available','Husky Mix','Adult','White/tan','Male','Large',NULL,325.00,''),(277,'Helene','Helene_1_671742d2e8a5f.jpg',NULL,NULL,'Meet Helene!','Available','Mixed Breed','Puppy','Brown','Female','Medium',NULL,325.00,''),(278,'Lily','Lily_1_673ce63b25b23.jpg','Lily_2_673ce63c71e29.jpg','Lily_3_673ce63d7eb68.jpg','Meet Lily! She’s a fun loving dog who gets a long great with others dogs. She loves girls, and is wary about men but can open up to them in the right environment. She does very well in the home. She’s fully potty trained, and if she needs to go potty she will let you know. She loves to play, gives kisses, napping and cuddling! Lily is a great companion to have! ','Available','Mixed Breed','Young','Grey','Female','Medium',NULL,325.00,''),(279,'Natalie','Natalie_1_671737520dd29.jpg',NULL,NULL,'Meet Natalie! This sweet girl is in a bonded pair with her sister Dixie. They are both fully potty and crate trained in a home. Both girls have  a medium energy level, love to play with people and other dogs but also enjoy relaxing. The girls keep each other entertained! They love to play with their toys and are full of goofy sisterly antics. When not playing, they are usually calm and quiet. Both adore affection, though Natalie will often nudge Dixie aside for extra pets. They would make any house a home.','Available','Mixed Breed','Adult','White','Female','Medium',NULL,325.00,''),(280,'Dixie','Dixie_1_671737863663a.jpg',NULL,NULL,'Meet Dixie! This sweet girl is in a bonded pair with her sister Natalie. They are both fully potty and crate trained in a home. Both girls have  a medium energy level, love to play with people and other dogs but also enjoy relaxing. The girls keep each other entertained! They love to play with their toys and are full of goofy sisterly antics. When not playing, they are usually calm and quiet. Both adore affection, though Natalie will often nudge Dixie aside for extra pets. They would make any house a home.','Available','Mixed Breed','Adult','White','Female','Medium',NULL,325.00,''),(281,'Peaches','Peaches_1_6717334a88ba3.jpg','Peaches_2_6717334aca82f.jpg',NULL,'Meet Peaches! Peaches is a sweet and super calm dog! She\'s low energy and is very low maintenance. She loves to sit on the couch and sleep . She likes to eat alone and shes getting on a good routine of when to eat and go to the bathroom! She\'s mostly potty trained, she just has to acclimate to new environments and get used to the routine of her owner. She\'s not scared or bothered by loud noises like vaccums or alarms. She loves to meet new people and is always wagging her tail. When she encounters other dogs, shes a bit timid and might get little scared. She also never barks! Shes loves the company of people and scratches and playing in the grass. Peaches has been an amazing addition to our home and deserves a loving owner!','Available','Mixed Breed','Adult','Tan and white','Female','Large',NULL,325.00,''),(282,'Josie','Josie_1_6717354760836.jpg','Josie_2_6736487dbadb6.jpg',NULL,'Meet Josie!','Available','Mixed Breed','Adult','Black and White','Female','Medium',NULL,325.00,''),(283,'Sky','Sky_1_671737dcc7439.jpg',NULL,NULL,'Meet Sky!','Available','Mixed Breed','Adult','Tan','Female','Medium',NULL,325.00,''),(284,'Jackie','Jackie_1_670c68347a84a.jpg',NULL,NULL,'Meet Jackie!','Available','Mixed Breed','Puppy','Tan','female','small',NULL,325.00,