\"size\":\"large\",\"fee\":\"200\",\"notes\":null}','2024-08-02 21:08:42','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(700,25,'172.17.0.1','Dog \'Sheba \' edited at index 234 with data: {\"name\":\"Sheba \",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Sheba was dumped at the Wakulla Co. Animal Shelter with only her kennel, not even her name. She was overlooked for weeks and weeks and was set to be euthanized before we rescued her. She\'s a husky\\/mix and is approximately 60 lbs. She\'s super sweet with her humans and wants to be the only pet in her home so she can shower her humans with attention. However, she does tolerate other dogs. Absolutely no cats! She is extremely smart, loyal, has lots of energy, loves to play catch, take walks and car rides, and give lots of kisses! She is house and crate trained and has learned to sit. She gets excited and still pulls when first on her leash, but she is getting better with every day. She whines quietly at times but has never barked. \\r\\n\",\"status\":\"Available\",\"breed\":\"Husky Mix\",\"age\":\"Adult\",\"color\":\"Black\\/White\",\"gender\":\"Female\",\"size\":\"Large\",\"fee\":\"200.00\",\"notes\":\"\"}','2024-08-02 21:08:55','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(701,25,'172.17.0.1','Dog \'Okra\' edited at index 210 with data: {\"name\":\"Okra\",\"photo\":\"Okra_1_66ad4bc03c647.jpg\",\"photo2\":\"Okra_2_66ad4bc08998d.jpg\",\"photo3\":\"Okra_3_66ad4bc0c9234.jpg\",\"description\":\"Okra was reached after being dumped in the woods, extremely emaciated. She has anxiety in loud\\/city outdoor settings but does great in rural suburban areas. She is potty trained and knows sit. She is low energy and doesn\\u2019t really play with toys. She weighs 32 pounds and has no destructive tendencies\\/no separation anxiety. She is looking for patient parents with time to allow her to adjust to new people and leave her be for a few days. She needs at least one week of accompanied introduction to get used to her family because of nervousness. Friendly with people and so far small low energy dogs in her house. Quirks: She\\u2019s like a cat! sleeps all day, will loaf and sit on you & is potty trained to her inside fake grass.\",\"status\":\"Available\",\"breed\":\"Shepard Mix\",\"age\":\"Adult\",\"color\":\"Tan\\/Brown\",\"gender\":\"Female\",\"size\":\"Small\",\"fee\":\"200.00\",\"notes\":\"\"}','2024-08-02 21:12:33','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(702,25,'172.17.0.1','Dog \'Okra\' edited at index 210 with data: {\"name\":\"Okra\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Okra was rescued after being dumped in the woods, extremely emaciated. She has anxiety in loud\\/city outdoor settings but does great in rural suburban areas. She is potty trained and knows sit. She is low energy and doesn\\u2019t really play with toys. She weighs 32 pounds and has no destructive tendencies\\/no separation anxiety. She is looking for patient parents with time to allow her to adjust to new people and leave her be for a few days. She needs at least one week of accompanied introduction to get used to her family because of nervousness. Friendly with people and so far small low energy dogs in her house. Quirks: She\\u2019s like a cat! sleeps all day, will loaf and sit on you & is potty trained to her inside fake grass.\",\"status\":\"Available\",\"breed\":\"Shepard Mix\",\"age\":\"Adult\",\"color\":\"Tan\\/Brown\",\"gender\":\"Female\",\"size\":\"Small\",\"fee\":\"200.00\",\"notes\":\"\"}','2024-08-02 21:15:55','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(703,25,'172.17.0.