\"description\":\"Landon is a sweet senior who needs a special person to give him a cozy home! This sweet boy was pulled only hours before he was set to be euthanized, how could you not love that smile. Landon is potty trained! Landon is the friendliest pup and loves other dogs and kids! His is crate and leashed train and knows a few commands\\u2026 what a smart boy! Landon struggles with arthritis but what old man doesn\'t? He would benefit best from a home without stairs. \",\"status\":\"available\",\"breed\":\"Mixed Breed\",\"age\":\"Adult\",\"color\":\"Brown\\/White\",\"gender\":\"male\",\"size\":\"large\",\"fee\":\"200\",\"notes\":null}','2024-08-02 22:48:25','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(751,25,'172.17.0.1','Dog \'Keith\' edited at index 97 with data: {\"name\":\"Keith\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Keith was rescued by Champs Chance from a backyard breeder situation. Him and his brother Toby lived the beginning of their life tied to a tree, on short chains.  He may be a bit shy at first, but once he warms up to you, he is the most loving and affectionate companion you could ask for. He adores making new dog friends. He is potty trained and crate trained and enjoys a walk on the leash once he\\u2019s comfortable. Keith doesn\\u2019t bark often! He loves to give kisses, and will only sit on the couch if you\\u2019re there to join him. Keith\\u2019s gentle nature and kind heart make him a beloved member of his human family and a joy to anyone lucky enough to meet him.\",\"status\":\"Available\",\"breed\":\"Mixed Breed\",\"age\":\"Adult\",\"color\":\"Brown\\/White\",\"gender\":\"Male\",\"size\":\"Medium\",\"fee\":\"200.00\",\"notes\":\"\"}','2024-08-02 22:49:53','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(752,25,'172.17.0.1','Dog \'Stella\' edited at index 55 with data: {\"name\":\"Stella\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Stella is super sweet, and full of personality, and energy. She thrives off of an active lifestyle but can chill out for long periods when you need her to. Stella will play with pretty much any toy and loves to play fetch. She knows a few basic commands. Stella is crate trained, house trained, and great on-leash apart from occasional reactivity to cats and other dogs. Off the leash, Stella does well with other pups and has had a few interactions with cats that went well! \",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Shepherd Mix\",\"age\":\"Puppy\",\"color\":\"Brown\\/Tan\",\"gender\":\"Female\",\"size\":\"Medium\",\"fee\":\"300.00\",\"notes\":\"\"}','2024-08-02 22:50:55','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(753,25,'172.17.0.1','Dog \'Hope\' edited at index 29 with data: {\"name\":\"Hope\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Sweet Hope is one of our longest residents at the rescue. She came to us from South Carolina, and she had been recovering from what looked to be a coyote attack. Hope is a very sweet girl who loves to show affection . She loves her walks and just being outside in general. Hope is very well trained. She does take a little bit to warm up due to her past but when she does she will love you and protect you. She\\u2019s silly in the cutest ways and would benefit from a home with people that can be there for her and help her be more confident as she is a little shy and scared. She is fully potty trained! Hope must be in a home with no other pets. \",\"status\":\"Available\",\"breed\":\"Mixed Breed\",\"age\":\"Adult\",\"color\":\"Tan\\/White\",\"gender\":\"Female\",\"size\":\"Medium\",\"fee\":\"200.00\",\"notes\":\"\"}','2024-08-02 22:51:26','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(754,25,'172.17.0.1','Dog \'Peppa\' edited at index 120 with data: {\"name\":\"Peppa\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Sweet Peppa was abandoned at a Boy Scout center and rescued by Champs Chance. It took us a bit to gain her trust, but once she realized she was safe, her true personality came out! Peppa has a heart of gold and is an absolute ray of sunshine.  She has a very calm demeanor, and enjoys resting on the couch and getting lots of snuggles. Peppa would benefit best from a quiet home. She is fully potty trained! Peppa is polite on a leash and enjoys her walks. We believe Peppa would be best as the only pet in the home. All this beautiful girl wants is a family of her own.  \",\"status\":\"Available\",\"breed\":\"Mixed Breed\",\"age\":\"Adult\",\"color\":\"Brindle\",\"gender\":\"Female\",\"size\":\"Medium\",\"fee\":\"200.00\",\"notes\":\"\"}','2024-08-02 22:51:59','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(755,25,'172.17.0.1','Dog \'Sam\' edited at index 94 with data: {\"name\":\"Sam\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Sam is the sweetest man ever! He is potty trained as well as crate trained. He is active and loves to go on runs with me, but he also is so sleepy most of the day and loves to cuddle and watch movies! Sam is sweet and never bites or barks. He loves all people! He is 55 lbs! He doesn\'t bite or chew anything unless it\'s his toys! Sam knows how to sit and stay and he\'s super active and loves to play catch, he also loves the pool! Sam is a really awesome dog! \",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Labrador Retreiver Mix\",\"age\":\"Adult\",\"color\":\"Black\\/White\",\"gender\":\"Male\",\"size\":\"Medium\",\"fee\":\"200.00\",\"notes\":\"\"}','2024-08-02 22:53:38','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(756,25,'172.17.0.1','Dog \'Pickles\' edited at index 62 with data: {\"name\":\"Pickles\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Pickles has come a long way, Champs Chance rescued this sweet girl from being euthanized. Pickles was terrified as people when brought it and now she absolutely loves all of the attention! Pickles is sweet as pie velcro dog, she wants to be where you are. Wiggles her butt kind of like a corgi when she walks.More of a low-rider than she appears in photos. Well-mannered and good with kids. Loves to eat and sleeps well in a crate! Pickles is potty trained. Good with short spurts outside and then ready to get back inside the A\\/C. Our kind of girl. She is also chill in the car.\",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Mixed Breed\",\"age\":\"Adult\",\"color\":\"Tan\\/White\",\"gender\":\"Female\",\"size\":\"Medium\",\"fee\":\"200.00\",\"notes\":\"\"}','2024-08-02 22:54:28','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(757,25,'172.17.0.1','Dog \'Curly\' edited at index 126 with data: {\"name\":\"Curly\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Curly came to us from Blountstown Police Department with his brothers Larry and Mo.  His brothers have been adopted so we need to find Curly his forever family.  Curly loves everyone that comes through the door and has never met a stranger.  He is great on walks and car rides, fully potty trained, loves lounging on the couch and is good with kids and dogs. Curly has a bit of separation anxiety if his family leaves for long periods of time. He would do best in a home with another dog! Curly has such a beautiful, gentle soul with so much love and joy to share.  \",\"status\":\"Available\",\"breed\":\"Dachshund Mix \",\"age\":\"Adult\",\"color\":\"Brown\\/White\",\"gender\":\"Male\",\"size\":\"Small\",\"fee\":\"200.00\",\"notes\":\"\"}','2024-08-02 22:56:12','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(758,25,'172.17.0.1','Dog \'Skye\' edited at index 197 with data: {\"name\":\"Skye\",\"photo\":null,\"photo2\":\"Skye_2_66ad6ccf26cf9.jpg\",\"photo3\":null,\"description\":\"Meet Skye! This handsome hunk is a major lover boy! We pulled him from the euthanasia list at his previous shelter. He gives the best hugs\\/kisses, and is always looking to get some love. He would make the perfect addition to any family.\",\"status\":\"Available\",\"breed\":\"Labrador Mix \",\"age\":\"Adult\",\"color\":\"Black\",\"gender\":\"Male\",\"size\":\"Small\",\"fee\":\"200.00\",\"notes\":\"\"}','2024-08-02 23:33:35','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(759,25,'172.17.0.1','Dog \'Joey\' edited at index 149 with data: {\"name\":\"Joey\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. \",\"status\":\"Available\",\"breed\":\"Mixed Breed\",\"age\":\"Young\",\"color\":\"Brindle\\/White\",\"gender\":\"Male\",\"size\":\"Medium\",\"fee\":\"300.00\",\"notes\":\"\"}','2024-08-02 23:33:43','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(760,25,'172.17.0.1','Dog \'Curly\' edited at index 126 with data: {\"name\":\"Curly\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Curly came to us from Blountstown Police Department with his brothers Larry and Mo.  His brothers have been adopted so we need to find Curly his forever family.  Curly loves everyone that comes through the door and has never met a stranger.  He is great on walks and car rides, fully potty trained, loves lounging on the couch and is good with kids and dogs. Curly has a bit of separation anxiety if his family leaves for long periods of time. He would do best in a home with another dog! Curly has such a beautiful, gentle soul with so much love and joy to share.  \",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Dachshund Mix \",\"age\":\"Adult\",\"color\":\"Brown\\/White\",\"gender\":\"Male\",\"size\":\"Small\",\"fee\":\"200.00\",\"notes\":\"\"}','2024-08-02 23:36:53','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(761,25,'172.17.0.1','Dog \'Landon\' edited at index 264 with data: {\"name\":\"Landon\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Landon is a sweet senior who needs a special person to give him a cozy home! This sweet boy was pulled only hours before he was set to be euthanized, how could you not love that smile. Landon is potty trained! Landon is the friendliest pup and loves other dogs and kids! His is crate and leashed train and knows a few commands\\u2026 what a smart boy! Landon struggles with arthritis but what old man doesn\'t? He would benefit best from a home without stairs. \",\"status\":\"Available\",\"breed\":\"Mixed Breed\",\"age\":\"Adult\",\"color\":\"Brown\\/White\",\"gender\":\"Male\",\"size\":\"Small\",\"fee\":\"200.00\",\"notes\":\"\"}','2024-08-02 23:37:01','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(762,25,'172.17.0.1','Dog \'Thumper \' edited at index 262 with data: {\"name\":\"Thumper \",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. \\r\\n\",\"status\":\"Available\",\"breed\":\"Black Labrador Mix \",\"age\":\"Young\",\"color\":\"Black\",\"gender\":\"Male\",\"size\":\"Small\",\"fee\":\"300.00\",\"notes\":\"\"}','2024-08-02 23:39:24','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(763,25,'172.17.0.1','Dog \'Joffrey\' edited at index 99 with data: {\"name\":\"Joffrey\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home.\\r\\n\\r\\nThis sweet boy is the perfect addition to any home. He absolutely adores people and loves to be by their side! Joffrey enjoys getting butt scratches, playing with his toys, and snuggling up. He is also a fan of pup cups and plain cheeseburgers. Despite his size, Joffrey is very well-mannered on the leash and does not pull hard. He is the definition of a gentle giant, this big teddy bear just wants to love and be loved on! We believe Joffrey would do best as the only pet in the home. Don\\u2019t worry though, just one of him is enough love to last a lifetime! \",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Mixed Breed\",\"age\":\"Adult\",\"color\":\"Brown\\/White\",\"gender\":\"Male\",\"size\":\"Medium\",\"fee\":\"200.00\",\"notes\":\"\"}','2024-08-02 23:41:28','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(764,25,'172.17.0.1','Dog \'Peck\' edited at index 155 with data: {\"name\":\"Peck\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Meet Peck! This beauty came to us with her mom and sisters after being dumped. Peck is a very happy dog who lives to give kisses to her people! She is very well behaved on walks and will walk right beside you on leash. She is very playful and loves her squeaky toys. Peck loves people and warms up to them very quickly, she has also been in a foster with 2 cats and was great with them! She enjoys her crate and will go right in when told. Well behaved in car rides and during baths.\",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Lemon Hound\\/ Dachshund Mix\",\"age\":\"Young\",\"color\":\"White\\/Cream\",\"gender\":\"Female\",\"size\":\"Small\",\"fee\":\"200.00\",\"notes\":\"\"}','2024-08-02 23:44:08','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(765,25,'172.17.0.1','Dog \'Ginger \' edited at index 258 with data: {\"name\":\"Ginger \",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. \\r\\n\",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Mixed Breed \",\"age\":\"Puppy\",\"color\":\"Light Brown\\/White\",\"gender\":\"Female\",\"size\":\"Small\",\"fee\":\"300.00\",\"notes\":\"\"}','2024-08-02 23:44:21','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(766,25,'172.17.0.1','Dog \'Sheba \' edited at index 234 with data: {\"name\":\"Sheba \",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Sheba was dumped at the Wakulla Co. Animal Shelter with only her kennel, not even her name. She was overlooked for weeks and weeks and was set to be euthanized before we rescued her. She\'s a husky\\/mix and is approximately 60 lbs. She\'s super sweet with her humans and wants to be the only pet in her home so she can shower her humans with attention. However, she does tolerate other dogs. Absolutely no cats! She is extremely smart, loyal, has lots of energy, loves to play catch, take walks and car rides, and give lots of kisses! She is house and crate trained and has learned to sit. She gets excited and still pulls when first on her leash, but she is getting better with every day. She whines quietly at times but has never barked. \\r\\n\",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Husky Mix\",\"age\":\"Adult\",\"color\":\"Black\\/White\",\"gender\":\"Female\",\"size\":\"Large\",\"fee\":\"200.00\",\"notes\":\"\"}','2024-08-02 23:44:29','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(767,25,'172.17.0.1','Dog \'Chip \' edited at index 183 with data: {\"name\":\"Chip \",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Meet Chip! This sweet boy was saved from being euthanized at his shelter. He is the sweetest boy, who definitely has some puppy energy! He gets along great with other dogs and enjoys playing with them. Chip also enjoys to lounge around after he\\u2019s had enough play time. \",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Hound Mix \",\"age\":\"Puppy\",\"color\":\"Tan\",\"gender\":\"Male\",\"size\":\"Small\",\"fee\":\"300.00\",\"notes\":\"\"}','2024-08-02 23:44:39','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(768,25,'172.17.0.1','Dog \'Costa\' edited at index 231 with data: {\"name\":\"Costa\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Sweet Costa was rescued after him and his brother Oakley were dumped. Oakley was hit by a car, and we sent him straight to surgery. Unfortunately, Oakley later passed from Parvo. Costa has had a very rough start to life and would love nothing more than a home and a family of his own. \",\"status\":\"Available\",\"breed\":\"Plott Hound Mix \",\"age\":\"Puppy\",\"color\":\"Brindle \",\"gender\":\"Male\",\"size\":\"Small\",\"fee\":\"300.00\",\"notes\":\"\"}','2024-08-02 23:47:47','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(769,47,'172.17.0.1','User account created','2024-08-03 18:16:16','Mozill