lina, and she had been recovering from what looked to be a coyote attack. Hope is a very sweet girl who loves to show affection . She loves her walks and just being outside in general. Hope is very well trained. She does take a little bit to warm up due to her past but when she does she will love you and protect you. She\\u2019s silly in the cutest ways and would benefit from a home with people that can be there for her and help her be more confident as she is a little shy and scared. She is fully potty trained! Hope must be in a home with no other pets. \",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Mixed Breed\",\"age\":\"Adult\",\"color\":\"Tan\\/White\",\"gender\":\"Female\",\"size\":\"Medium\",\"fee\":\"200.00\",\"notes\":\"\"}','2024-08-30 18:10:01','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(826,25,'172.17.0.1','Dog \'\' removed from JSON at index: 30','2024-08-30 18:10:11','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(827,25,'172.17.0.1','Dog \'Joffrey\' edited at index 99 with data: {\"name\":\"Joffrey\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home.\\r\\n\\r\\nThis sweet boy is the perfect addition to any home. He absolutely adores people and loves to be by their side! Joffrey enjoys getting butt scratches, playing with his toys, and snuggling up. He is also a fan of pup cups and plain cheeseburgers. Despite his size, Joffrey is very well-mannered on the leash and does not pull hard. He is the definition of a gentle giant, this big teddy bear just wants to love and be loved on! We believe Joffrey would do best as the only pet in the home. Don\\u2019t worry though, just one of him is enough love to last a lifetime! \",\"status\":\"Available\",\"breed\":\"Mixed Breed\",\"age\":\"Adult\",\"color\":\"Brown\\/White\",\"gender\":\"Male\",\"size\":\"Medium\",\"fee\":\"200.00\",\"notes\":\"\"}','2024-08-30 18:12:13','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(828,25,'172.17.0.1','Dog \'Keith\' edited at index 97 with data: {\"name\":\"Keith\",\"photo\":null,\"photo2\":\"Keith_2_66d20bbee0b54.jpg\",\"photo3\":\"Keith_3_66d20bbf843d7.jpg\",\"description\":\"Keith was rescued by Champs Chance from a backyard breeder situation. Him and his brother Toby lived the beginning of their life tied to a tree, on short chains.  He may be a bit shy at first, but once he warms up to you, he is the most loving and affectionate companion you could ask for. He adores making new dog friends. He is potty trained and crate trained and enjoys a walk on the leash once he\\u2019s comfortable. Keith doesn\\u2019t bark often! He loves to give kisses, and will only sit on the couch if you\\u2019re there to join him. Keith\\u2019s gentle nature and kind heart make him a beloved member of his human family and a joy to anyone lucky enough to meet him.\",\"status\":\"Available\",\"breed\":\"Mixed Breed\",\"age\":\"Adult\",\"color\":\"Brown\\/White\",\"gender\":\"Male\",\"size\":\"Medium\",\"fee\":\"200.00\",\"notes\":\"\"}','2024-08-30 18:13:20','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(829,25,'172.17.0.1','Dog \'Timber\' edited at index 123 with data: {\"name\":\"Timber\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Meet Timber, our bashful girl seeking a forever home! \\ud83c\\udf1f This sweet hound was found as a stray, and her heart is still mending. Timber\'s shyness is like a delicate flower waiting to bloom with love and patience.  Let\'s make her life extra special by finding Timber a loving family who will t