 Safari/604.1'),(951,25,'172.17.0.1','Animal added: {\"name\":\"Rowdy \",\"photo\":\"Rowdy _1_670c50317cdb2.jpg\",\"photo2\":\"Rowdy _2_670c5031c94d7.jpg\",\"photo3\":null,\"description\":\"Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home.\",\"status\":\"available\",\"breed\":\"Black Lab\\/Sharpei Mix \",\"age\":\"Puppy\",\"color\":\"Black \",\"gender\":\"male\",\"size\":\"large\",\"fee\":\"325\",\"notes\":null}','2024-10-13 22:56:50','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(952,25,'172.17.0.1','Dog \'Nola\' edited at index 206 with data: {\"name\":\"Nola\",\"photo\":\"Nola_1_670c50d2623f0.jpg\",\"photo2\":null,\"photo3\":null,\"description\":\"Foster Description: \\r\\nMeet Nola! I have been fostering because of the hurricane. She is looking for a forever home and is the sweetest girl you will ever meet. I immediately fell in love with her. Nola loves people and warms up to them very quickly, and is extremely friendly to anyone she meets. She is great with children and other dogs. She is calm and well behaved but can also be playful and puppy-like. Such a gentle soul with a loving heart who enjoys cuddles and pets. I have a roommate who is afraid of dogs, but she met Nola and immediately felt safe and loves her. She enjoys car rides, walks, toys, and being outdoors. Nola is potty trained and will go number 1 and 2 every time you take her outside. She still needs some help with leash training. She has also already been spayed.\",\"status\":\"Available\",\"breed\":\"Mixed breed\",\"age\":\"Adult\",\"color\":\"Grey\\/White\",\"gender\":\"Female\",\"size\":\"Large\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-13 22:59:31','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(953,25,'172.17.0.1','Dog \'Nola\' edited at index 206 w