she is one of our most loving girls by far! She gets along well with males her size, but we always recommend a meeting prior to foster commitment and a home with no female dogs or small children. She is currently going through heartworm treatment.\",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Mixed Breed\",\"age\":\"Adult\",\"color\":\"Black\\/White\",\"gender\":\"Female\",\"size\":\"Medium\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-13 23:55:39','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(976,25,'172.17.0.1','Dog \'Bellamy\' edited at index 10 with data: {\"name\":\"Bellamy\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Meet BELLAMY!\\r\\n\\r\\nBellamy has been with us for a while after being surrendered from a farm home. We were told he did not do well with the farm animals such as chickens and pigs, so he will not be able to be in such a home environment. However, his short-term fosters during the January storm front gave us fantastic feedback of how he does in a traditional fenced yard home with other dogs!\\r\\n\\r\\n\\\"Mr. Bellamy was a great house guest for the cold weather break from the rescue. He has been friendly with all our dogs [small\\/medium], easy to correct, and eager to please. He needs slow introductions to new people and may have issues with large reactive dogs. He met each of our dogs individually and all he wanted to do was play with everyone!\\\"\\r\\n\\r\\nBellamy will need a foster or adopter with experience with large dogs due to his size. Once he gets to know you, he is the cuddliest dog out there! All he\'s wanted for a long time is a home that loves him unconditionally and will not judge him for his size or look.\",\"status\":\"Available\",\"breed\":\"Mixed Breed\",\"age\":\"Adult\",\"color\":\"White\\/Brindle\",\"gender\":\"Male\",\"size\":\"Large\",\"fee\":\"325.00\",\"notes\":\"\"}','2024-10-13 23:55:43','Mozilla/5.0 (Windows NT 1