ays been respectful of other dogs and his 4 foster fur siblings. He is eager to please so it would be easy to teach new tasks to him. We can\'t say enough how sweet he is!! Please please help Buddy Boy find a forever home full of love and patience. You will not regret giving him a home. Fixed, UTD on vaccines, microchipped, HW-.\",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Pit Bull Terrier\",\"age\":\"Adult\",\"color\":\"Black\",\"gender\":\"Male\",\"size\":\"Large\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-13 23:56:13','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(980,25,'172.17.0.1','Dog \'Cameron\' edited at index 17 with data: {\"name\":\"Cameron\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. Fixed, UTD on vaccines, microchipped, HW+. Undergoing heartworm treatment.\\r\\n\",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Bulldog Mix\",\"age\":\"Adult\",\"color\":\"White\\/Tan\",\"gender\":\"Male\",\"size\":\"Medium\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-13 23:56:24','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(981,25,'172.17.0.1','Dog \'Daisy\' edited at index 22 with data: {\"name\":\"Daisy\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home.\\r\\nFixed, UTD on vaccines, microchipped, HW-.\",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Terrier Mix\",\"age\":\"Young\",\"color\":\"White\\/Black Spotted\",\"gender\":\"Female\",\"size\":\"Medium\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-13 23:56:56','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(982,25,'172.17.0.1','Dog \'Red 