{\"name\":\"Princess\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Princess had a rough start, coming to us from the top of a euthanasia list at a rural shelter in Alabama a few months ago. We knew she did not deserve to die and had to save this sweet girl. Princess appears to be a lab or hound mix, weighs approximately 40lbs, and we believe her age to be 2-3 years old.\\r\\n\\r\\nPrincess can be described as a cuddly, loving girl who is eager to lay in bed or have some fun, whatever her person is up to! She does well with other dogs but an introduction prior to adoption is always recommended.\\r\\n\\r\\nPrincess is potty trained, spayed, UTD on vaccines, and heartworm positive. All costs of heartworm treatment are covered by Champs Chance and her adoption fee of $200. \",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Chocolate Lab\\/Hound Mix\",\"age\":\"Adult\",\"color\":\"Brown\",\"gender\":\"Female\",\"size\":\"Large\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-13 23:58:34','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(989,25,'172.17.0.1','Dog \'Bubba\' edited at index 44 with data: {\"name\":\"Bubba\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. Undergoing heartworm treatment.\\r\\n\",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Mixed Breed\",\"age\":\"Adult\",\"color\":\"Brown\",\"gender\":\"Male\",\"size\":\"Medium\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-13 23:58:49','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(990,25,'172.17.0.1','Dog \'Leilani\' edited at index 47 with data: {\"name\":\"Leilani\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy