age\":\"Adult\",\"color\":\"Tan\",\"gender\":\"Female\",\"size\":\"Medium\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-14 00:00:21','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(997,25,'172.17.0.1','Dog \'Sam\' edited at index 94 with data: {\"name\":\"Sam\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Sam is the sweetest man ever! He is potty trained as well as crate trained. He is active and loves to go on runs with me, but he also is so sleepy most of the day and loves to cuddle and watch movies! Sam is sweet and never bites or barks. He loves all people! He is 55 lbs! He doesn\'t bite or chew anything unless it\'s his toys! Sam knows how to sit and stay and he\'s super active and loves to play catch, he also loves the pool! Sam is a really awesome dog! \",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Labrador Retreiver Mix\",\"age\":\"Adult\",\"color\":\"Black\\/White\",\"gender\":\"Male\",\"size\":\"Medium\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-14 00:00:33','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(998,25,'172.17.0.1','Dog \'Keith\' edited at index 97 with data: {\"name\":\"Keith\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Keith was rescued by Champs Chance from a backyard breeder situation. Him and his brother Toby lived the beginning of their life tied to a tree, on short chains.  He may be a bit shy at first, but once he warms up to you, he is the most loving and affectionate companion you could ask for. He adores making new dog friends. He is potty trained and crate trained and enjoys a walk on the leash once he\\u2019s comfortable. Keith doesn\\u2019t bark often! He loves to give kisses, and will only sit on the couch if you\\u2019re there to join him. Keith\\u2019s gentle nature and kind heart make him a beloved member of his human family and a joy to anyone lucky enough to meet him.\",\"status\":\"Available\",\"breed\":\"Mixed Breed\",\"age\":\"Adult\",\"color\":\"Brown\\/White\",\"gender\":\"Male\",\"size\":\"Medium\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-14 00:00:46','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(999,25,'172.17.0.1','Dog \'Joffrey\' edited at index 99 with data: {\"name\":\"Joffrey\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home.\\r\\n\\r\\nThis sweet boy is the perfect addition to any home. He absolutely adores people and loves to be by their side! Joffrey enjoys getting butt scratches, playing with his toys, and snuggling up. He is also a fan of pup cups and plain cheeseburgers. Despite his size, Joffrey is very well-mannered on the leash and does not pull hard. He is the definition of a gentle giant, this big teddy bear just wants to love and be loved on! We believe Joffrey would do best as the only pet in the home. Don\\u2019t worry though, just one of him is enough love to last a lifetime! \",\"status\":\"Available\",\"breed\":\"Mixed Breed\",\"age\":\"Adult\",\"color\":\"Brown\\/White\",\"gender\":\"Male\",\"size\":\"Medium\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-14 00:00:56','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(1000,25,'172.17.0.1','Dog \'Big Girl\' edited at index 110 with data: {\"name\":\"Big Girl\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\" Big Girl is a 5 year old German Shepard that was abandoned to no fault of her own. She is fully vetted, HW negative and spayed. She\\u2019s house trained, crate trained, knows many commands, gets along with cats and other dogs, loves car rides and walks well on a leash. Her favorite past time is playing soccer or with her red ball. She\\u2019s perfectly well mannered and in excellent health.\",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"German Shepard \",\"age\":\"Adult \",\"color\":\"Tan and Black\",\"gender\":\"Female\",\"size\":\"Large\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-14 00:01:05','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(1001,25,'172.17.0.1','Dog \'Meatloaf\' edited at index 111 with data: {\"name\":\"Meatloaf\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home.\\r\\n\",\"status\":\"Available\",\"breed\":\"Mixed Breed\",\"age\":\"Adult\",\"color\":\"Brown\",\"gender\":\"Male\",\"size\":\"Medium\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-14 00:01:18','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(1002,25,'172.17.0.1','Dog \'Shadow\' edited at index 116 with data: {\"name\":\"Shadow\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home.\",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Mixed Breed\",\"age\":\"Puppy\",\"color\":\"Black\",\"gender\":\"Female\",\"size\":\"Medium\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-14 00:01:31','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(1003,25,'172.17.0.1','Dog \'Peppa\' edited at index 120 with data: {\"name\":\"Peppa\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Sweet Peppa was abandoned at a Boy Scout center and rescued by Champs Chance. It took us a bit to gain her trust, but once she realized she was safe, her true personality came out! Peppa has a heart of gold and is an absolute ray of sunshine.  She has a very calm demeanor, and enjoys resting on the couch and getting