s, fully potty trained, loves lounging on the couch and is good with kids and dogs. Curly has a bit of separation anxiety if his family leaves for long periods of time. He would do best in a home with another dog! Curly has such a beautiful, gentle soul with so much love and joy to share.  \",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Dachshund Mix \",\"age\":\"Adult\",\"color\":\"Brown\\/White\",\"gender\":\"Male\",\"size\":\"Small\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-14 00:02:03','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(1006,25,'172.17.0.1','Dog \'Bambi\' edited at index 132 with data: {\"name\":\"Bambi\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. \",\"status\":\"Available\",\"breed\":\"Mixed Breed\",\"age\":\"Adult\",\"color\":\"Black\\/White\",\"gender\":\"Female\",\"size\":\"Medium\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-14 00:02:13','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(1007,25,'172.17.0.1','Dog \'Joey\' edited at index 149 with data: {\"name\":\"Joey\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. \",\"status\":\"Available\",\"breed\":\"Mixed Breed\",\"age\":\"Young\",\"color\":\"Brindle\\/White\",\"gender\":\"Male\",\"size\":\"Medium\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-14 00:02:23','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(1008,25,'172.17.0.1','Dog \'Beau\' edited at index 150 with data: {\"name\":\"Beau\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Come and meet our adorable and friendly dog, the perfect furry companion to add love 