e \",\"gender\":\"Male\",\"size\":\"Small\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-14 00:03:47','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(1014,25,'172.17.0.1','Dog \'Sunny\' edited at index 193 with data: {\"name\":\"Sunny\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Meet Sunny! This sweet girl was an owner surrender who ended up at Champs. She has been used to living in a home for her whole life, so we would love to place her with a forever family! She is so affectionate, and loves to get loved on. She has a pretty calm demeanor, and is definitely a couch potato. She can also be playful and enjoys having her toys. Sunny also has lived with a small child\\/baby, and was amazing\\/gentle! We believe Sunny would do best as the only dog in the home. \\r\\n\",\"status\":\"Available\",\"breed\":\"Mixed Breed \",\"age\":\"Adult\",\"color\":\"Tan\\/White\",\"gender\":\"Male\",\"size\":\"Small\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-14 00:03:57','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(1015,25,'172.17.0.1','Dog \'Aspen \' edited at index 195 with data: {\"name\":\"Aspen \",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Meet Aspen! This girl has the most beautiful blue eyes and the silliest ears! She is an absolute sweetheart who would make the perfect addition to any family. We reached Aspen from the euthanasia list at her previous shelter. She loves to play with toys, other doggies, and people! This girl is the perfect blend of fun and affection. \",\"status\":\"Available\",\"breed\":\"Australian Blue Heeler\\/ Catahoula \",\"age\":\"Young\",\"color\":\"White\\/tan \",\"gender\":\"Male\",\"size\":\"Small\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-14 00:04:06','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(1016,2