ion to add love and joy to your home. \\r\\n\",\"status\":\"Available\",\"breed\":\"Mixed Breed \",\"age\":\"Young\",\"color\":\"Tan\\/White\",\"gender\":\"Male\",\"size\":\"Small\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-14 00:25:05','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(1063,25,'172.17.0.1','Dog \'Landon\' edited at index 264 with data: {\"name\":\"Landon\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Landon is a sweet senior who needs a special person to give him a cozy home! This sweet boy was pulled only hours before he was set to be euthanized, how could you not love that smile. Landon is potty trained! Landon is the friendliest pup and loves other dogs and kids! His is crate and leashed train and knows a few commands\\u2026 what a smart boy! Landon struggles with arthritis but what old man doesn\'t? He would benefit best from a home without stairs. \",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Mixed Breed\",\"age\":\"Adult\",\"color\":\"Brown\\/White\",\"gender\":\"Male\",\"size\":\"Large\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-14 00:25:19','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(1064,25,'172.17.0.1','Dog \'Jovie \' edited at index 267 with data: {\"name\":\"Jovie \",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Jovie is a happy puppy that loves to play. Would be best in an active home as he really likes to run. He would do well with another playful companion. He is almost potty trained. Working very hard on that with rare incidents at this point. He\'s smart, highly food motivated. Loves kids, but is teething and doesn\'t know his strength. He\'s great with other dogs and cats. He a snuggle bug and wants to cuddle to sleep. Not the biggest fan of crates! \",\"status\":\"Available\",\"breed\":\"Mixed Breed\",\"age\":\"Puppy\",\"color\":\"Brown \",\"gender\":\"Male\",\"size\":\"Small\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-14 00:25:56','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(1065,25,'172.17.0.1','Dog \'Finn\' edited at index 268 with data: {\"name\":\"Finn\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Meet Finn, a charming 9-month-old chocolate lab! With his stunning chocolate coat and expressive hazel eyes, Finn is a true head-turner. This energetic pup brings a spark of joy to every moment, whether he\'s bounding around the yard or exploring new adventures at the dog park. Finn loves meeting new friends, both human and pup, and is always ready to spread happiness. He would do great in a home with another dog and is kid-friendly and okay with cats. He is both neutered and up to date on shots. He can\\u2019t wait to find his forever family and share all the fun and love he has to offer! \",\"status\":\"Available\",\"breed\":\"Chocolate Lab Mix \",\"age\":\"Young\",\"color\":\"Brown\",\"gender\":\"Male\",\"size\":\"Large\",\"fee\":\"325\",\"notes\":\"\"}','2024-10-14 00:27:41','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(1066,25,'172.17.0.1','Animal added: {\"name\":\"Sky\",\"photo\":\"Sky_1_670c65f599048.jpg\",\"photo2\":null,\"photo3\":null,\"description\":\"Meet Sky!\",\"status\":\"available\",\"breed\":\"Mixed Breed\",\"age\":\"Adult\",\"color\":\"Tan\",\"gender\":\"female\",\"size\":\"medium\",\"fee\":\"325\",\"notes\":null}','2024-10-14 00:29:41','Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36'),(1067,25,'172.17.0.1','Animal added: {\"name\":\"Jackie\",\"photo\":\"Jackie_1_670c68347a84a.jpg\",\"photo2\":null,\"photo3\":null,\"description\":\"Meet Jackie!\",\"status\":\"available\",\"breed\":\"Mixed Breed\",\"age\":\"Puppy\",\"color\":\"Tan\",\"gender\":\"female\",\"size\":\"s