nd people! This girl is the perfect blend of fun and affection. \",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Australian Blue Heeler\\/ Catahoula \",\"age\":\"Young\",\"color\":\"White\\/tan \",\"gender\":\"Female\",\"size\":\"Medium\",\"fee\":\"325.00\",\"notes\":\"\"}','2024-10-22 06:24:31','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(1179,25,'172.17.0.1','Dog \'Peppa\' edited at index 120 with data: {\"name\":\"Peppa\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Sweet Peppa was abandoned at a Boy Scout center and rescued by Champs Chance. It took us a bit to gain her trust, but once she realized she was safe, her true personality came out! Peppa has a heart of gold and is an absolute ray of sunshine.  She has a very calm demeanor, and enjoys resting on the couch and getting lots of snuggles. Peppa would benefit best from a quiet home. She is fully potty trained! Peppa is polite on a leash and enjoys her walks. We believe Peppa would be best as the only pet in the home. All this beautiful girl wants is a family of her own.  \",\"status\":\"Available\",\"breed\":\"Mixed Breed\",\"age\":\"Adult\",\"color\":\"Brindle\",\"gender\":\"Female\",\"size\":\"Medium\",\"fee\":\"325.00\",\"notes\":\"\"}','2024-10-22 06:24:38','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(1180,25,'172.17.0.1','Dog \'Okra\' edited at index 210 with data: {\"name\":\"Okra\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Okra was rescued after being dumped in the woods, extremely emaciated. She has anxiety in loud\\/city outdoor settings but does great in rural suburban areas. She is potty trained and knows sit. She is low energy and doesn\\u2019t really play with toys. She weighs 32 pounds and has no destructive tendencies\\/no separation anxiety. She is looking for patient parents with time to allow her to adjust to new people and leave her be for a few days. She needs at least one week of accompanied introduction to get used to her family because of nervousness. Friendly with people and so far small low energy dogs in her house. Quirks: She\\u2019s like a cat! sleeps all day, will loaf and sit on you & is potty trained to her inside fake grass.\",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Shepard Mix\",\"age\":\"Adult\",\"color\":\"Tan\\/Brown\",\"gender\":\"Female\",\"size\":\"Small\",\"fee\":\"325.00\",\"notes\":\"\"}','2024-10-22 06:25:13','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(1181,25,'172.17.0.1','Dog \'Daphne\' edited at index 241 with data: {\"name\":\"Daphne\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Come and meet our adorable and friendly dog, the perfect furry companion to add love and joy to your home. \",\"status\":\"Available \\/ In Foster Home\",\"breed\":\"Hound Mix \",\"age\":\"Puppy\",\"color\":\"Black\\/Brown \",\"gender\":\"Female\",\"size\":\"Small\",\"fee\":\"325.00\",\"notes\":\"\"}','2024-10-22 06:25:20','Mozilla/5.0 (iPhone; CPU iPhone OS 16_6_1 like Mac OS X) AppleWebKit/605.1.15 (KHTML, like Gecko) Version/16.6 Mobile/15E148 Safari/604.1'),(1182,25,'172.17.0.1','Dog \'Keith\' edited at index 97 with data: {\"name\":\"Keith\",\"photo\":null,\"photo2\":null,\"photo3\":null,\"description\":\"Keith was rescued by Champs Chance from a backyard breeder situation. Him and his brother Toby lived the beginning of their life tied to a tree, on short chains.  He may be a bit shy at first, but once he warms up to you, he is the most loving and affectionate companion you could ask for. He adores making new dog friends. He is potty trained and crate trained and enjoys a walk on the leash once he\\u2019s comfortable. Keith doesn\\u2019t bark often! He loves to give 