mall\",\"fee\":\"325.00\",\"notes\":\"\"}','2024-11-18 16:17:47','Mozilla/5.0 (Linux; Android 10; K) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/130.0.0.0 Safari/537.36'),(1324,67,'172.17.0.1','Dog \'Chestnut\' edited at index 240 with data: {\"name\":\"Chestnut\",\"photo\":null,\"photo2\":null,\"photo3\":\"Chestnut_3_673b696be6512.jpg\",\"description\":\"Meet Chestnut! Chestnut is very good about letting you know when she needs to go to the bathroom. She usually stands by the front door and waits for you to take her. She has had little to no accidents inside. She is a very friendly, energetic dogs who is great with people and great with other animals. Chestnut is crate trained and doesn\\u2019t bark or whine in her crate unless she needs to go potty. She knows how to sit, shake, lay, and stay all with commands. She loves being lazy and cuddling but loves running around and playing even more. She loves attention and is very playful, but she knows her boundaries and doesn\\u2019t play too rough. She\\u2019s is a loyal friend and is a great puppy. \",\"status\":\"Available\",\"breed\":\"Blackmouth Cur Mix\",\"age\":\"Puppy\",\"color\":\"Brown \",\"gender\":\"Female\",\"size\":\"Medium\",\"fee\":\"325.00\",\"notes\":\"\"}','2024-11-18 16:21:00','Mozilla/5.0 (Linux; Android 10; K) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/130.0.0.0 Safari/537.36'),(1325,67,'172.17.0.1','Dog \'Ginny \' edited at index 220 with data: {\"name\":\"Ginny \",\"photo\":null,\"photo2\":\"Ginny _2_673b6aa02c71c.jpg\",\"photo3\":\"Ginny _3_673b6aa05a396.jpg\",\"description\":\"Ginny is one of the puppies in the Harry Potter litter! She is truly the sweetest, most loving dog. She\\u2019s crate trained but her favorite thing is to sleep with you. She gets the zoomies once a day but other than that she\\u2019s pretty lazy. Loves other dogs, gets scared of areas with a lot of noise at first but she does warm up pretty quick. She knows how to sit, come, and is working on the paw command. She als